import React from 'react';
import Form from './components/Form';
import Todo from './components/Todo';
// import logo from './logo.svg';
import './App.css';

interface Props {
  text: string;
}

class App extends React.Component<Props> {
  render() {
    const { text } = this.props;
    return (
      <div>
        <Form />
        <ul>
          <li>
            <Todo text="hogehoge" />
          </li>
        </ul>
      </div>
    );
  }
}

export default App;
